head.script:
const e = "system",
  t = "dark",
  c = "dark",
  o = "data-fr-theme",
  a = "data-fr-scheme",
  r = `:root[${o}], :root[${a}]`,
  m = () => {
    document.documentElement.setAttribute(o, c),
      (document.documentElement.style.colorScheme = "dark");
  },
  n = () => {
    window.matchMedia("(prefers-color-scheme: dark)").matches && m();
  };
(() => {
  if (document.documentElement.matches(r)) {
    const c = (() => {
        try {
          return "localStorage" in window && null !== window.localStorage;
        } catch (e) {
          return !1;
        }
      })()
        ? localStorage.getItem("scheme")
        : "",
      o = document.documentElement.getAttribute(a);
    switch (!0) {
      case c === t:
        m();
        break;
      case c === e:
        n();
        break;
      case o === t:
        m();
        break;
      case o === e:
        n();
    }
  }
})();

body.script:
const PRODUCTION_ENV = "prod";
const xhr = new XMLHttpRequest();
xhr.open("GET", "/env.json", false);
xhr.send(null);

if (xhr.status === 200) {
  const env = JSON.parse(xhr.responseText);
  const analytics = {
    domain: env.domain,
    cmp: { id: "tarteaucitron" },
    collection: "load",
    site: {
      environment: env.env,
      entity: "SPM || SIG",
      target: "information",
      type: "standard",
      lang: "fr",
    },
    page: {
      name: "Erreur 404",
      depth: 1,
      labels: ["fr", "current", "error-404"],
    },
    funnel: {},
    isActionEnabled: true,
  };
  const dsfr = { analytics };
  if (env.env === PRODUCTION_ENV) {
    dsfr.production = true;
  }
  window.dsfr = dsfr;
} else {
  console.error("Failed to load JSON:", xhr.status, xhr.statusText);
}
